column8:
　●洗車後の濡れたままのボディに液剤を吹き付けて吹き上げるだけです。<BR>
●短時間で本格的な撥水コーティングが完成します。<BR>
●全車色使用可能で、効果は約2～3ヶ月持続します。<BR>
<BR>
使用条件<BR>
1：キズの原因になるのであらかじめ水洗いし、砂埃や汚れを落としてください。<BR>
2：使用前に容器をよく振ってください。ボディ面に水が残っている状態で全体にスプレーして下さい。<BR>
3：固く絞ったウエスで吹き上げて仕上げて下さい。※セーム皮は使用しないで下さい。<style type="text/css">
